//import Firebase from "../../../../Firebase/Auth/GoogleAuth"
import { Component } from 'react';
import './Adv.css';
import firebase from "firebase/app";
import "firebase/auth";

class AdvRegister extends Component {

      
    state = {
        isSignedIn: false,
        User: null
    }

    signIn(){
        const firebaseConfig = {
            apiKey: "AIzaSyAZdZGwvYnQrslKrYMTMaoIDaBzC2y_npA",
            authDomain: "fiverr-proj-38f57.firebaseapp.com",
            databaseURL: "https://fiverr-proj-38f57.firebaseio.com",
            projectId: "fiverr-proj-38f57",
            storageBucket: "fiverr-proj-38f57.appspot.com",
            messagingSenderId: "1014404158767",
            appId: "1:1014404158767:web:304a2c1b2307e5a3bc3dda"
        };
        firebase.initializeApp(firebaseConfig);
        firebase.auth.signInWithPopup(firebase.auth.GoogleAuthProvider()).then(function(result) {
        console.log(result.displayName)
        }).catch(function(error) {
        // Handle Errors here.
        console.log(error.message)
        });
    }

    render(){
        return(
            <div class="container">
            <div class="card o-hidden border-0 shadow-lg my-5">
                <div class="card-body p-0">
                    <div class="row">
                        <div class="col-lg-5 d-none d-lg-block bg-register-image"></div>
                        <div class="col-lg-7">
                            <div class="p-5">
                                <div class="text-center">
                                    <h1 class="h4 text-gray-900 mb-4">Create an Account!</h1>
                                </div>
                                <form class="user">
                                    <div class="form-group row">
                                        <div class="col-sm-6 mb-3 mb-sm-0">
                                            <input type="text" class="form-control form-control-user" id="exampleFirstName" placeholder="First Name"/>
                                        </div>
                                        <div class="col-sm-6">
                                            <input type="text" class="form-control form-control-user" id="exampleLastName" placeholder="Last Name"/>
                                        </div>
                                    </div>
                                    <div class="form-group">
                                        <input type="email" class="form-control form-control-user" id="exampleInputEmail" placeholder="Email Address"/>
                                    </div>
                                    <div class="form-group row">
                                        <div class="col-sm-6 mb-3 mb-sm-0">
                                            <input type="password" class="form-control form-control-user" id="exampleInputPassword" placeholder="Password"/>
                                        </div>
                                        <div class="col-sm-6">
                                            <input type="password" class="form-control form-control-user" id="exampleRepeatPassword" placeholder="Repeat Password"/>
                                        </div>
                                    </div>
                                    <a href="login.html" class="btn btn-primary btn-user btn-block">
                                        Register Account
                                    </a>
                                    <hr/>
                                    <button onClick={() => Firebase()}  class="btn btn-google btn-user btn-block">
                                        <i class="fab fa-google fa-fw"></i> Register with Google
                                    </button>
                                    <a href="index.html" class="btn btn-facebook btn-user btn-block">
                                        <i class="fab fa-facebook-f fa-fw"></i> Register with Facebook
                                    </a>
                                </form>
                                <hr/>
                                <div class="text-center">
                                    <a class="small" href="forgot-password.html">Forgot Password?</a>
                                </div>
                                <div class="text-center">
                                    <a class="small" href="login.html">Already have an account? Login!</a>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            <button onClick={() => this.signIn()}>please Click</button>
        </div>
        );
    }
}

 export default AdvRegister;
